    false,nt"url": null,nt"notes": "This annual narrative report for the Winona
    District of the Upper Mississippi River National Wildlife and Fish Refuge summarizes
    Refuge activities during the 2007 fiscal year.  The report begins with an introduction
    to the Refuge and a summary of the yearu2019s highlights and climate conditions.
     Information about monitoring and studies- including surveys and censuses- is provided
    next.  Habitat restoration and management projects are also covered; activities
    include riverine restoration, water level management, timber management, fire management,
    and vegetation control.  Fish and wildlife management is discussed next with emphasis
    on bird banding.  Coordination activities, such as interagency coordination and
    private land activities, are outlined.  The resource protection section provides
    information about law enforcement, permits, and land acquisition support.  Information
    about public education and recreation is given including visitor services and outreach.
    Refuge planning and administration are discussed.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
